import React from "react";
import PageWrapper from "./components/PageWrapper";
import Login from "./components/Login";
import SignUp from "./components/SignUp";
import Home from "./components/Home";
import Profile from "./components/Profile";
import {Route, Routes, Navigate} from "react"

function App() {
 
  return (
    <React.Fragment>
      <PageWrapper>
       <Login />
      </PageWrapper>

      <PageWrapper>
        <SignUp />
      </PageWrapper>

      <PageWrapper>
        <Home />
      </PageWrapper>

      <PageWrapper>
        <Profile />
      </PageWrapper>

    </React.Fragment>
  );
}

export default App;
